import React from 'react';

const Product = ({ title, description, image, memberPrice, regularPrice }) => {
  return (
    <div style={{ border: '1px solid #ccc', padding: '10px', margin: '10px', textAlign: 'center' }}>
      <img src={image} alt={title} style={{ maxWidth: '100%', maxHeight: '200px' }} />
      <h3>{title}</h3>
      <p>{description}</p>
      <button>{`Member Price: $${memberPrice}`}</button>
      <button>{`Regular Price: $${regularPrice}`}</button>
    </div>
  );
};

export default Product;
